Метод анализа и синтеза предлагает двухступенчатую стратегию для достижения понимания. В стадии анализа мы рассматриваем мельчайшие части того, что мы изучаем, — его «атомы» — в метафорическом смысле этого слова. В случае удачного анализа мы определяем малые части с простыми свойствами, которые можно резюмировать в виде точных законов. Например:
в изучении света атомы — это лучи чистых спектральных цветов;
в изучении исчисления атомы — это бесконечно малые и их отношения:
в изучении движения атомы — это скорость и ускорение;
в изучении механики атомы — это силы.

В научной литературе активно обсуждается по крайней мере три типа параллельных вселенных:

а) гиперпространство, или высшие измерения;
б) Мультивселенная;
в) квантовые параллельные вселенные.
